import React from "react";

const ResultDisplay = ({ result }) => {
  return (
    <div style={{ marginTop: "20px", padding: "10px", border: "1px solid gray" }}>
      <h3>Result:</h3>
      <p>{result.result}</p>
    </div>
  );
};

export default ResultDisplay;
